import React from 'react';
import SelectQuantity from './SelectQuantity';

function ShoppingRow({ item }) {
    return (
        <tr className='itemrow'>
            <td>
                <input type="text" value={item.name}/>
            </td>
            <td>
                <input type="text" value={item.price}/>
                
            </td>
        </tr>
    );
}

export default ShoppingRow;
